import "./App.css";
import React, { useEffect } from "react";
import AOS from "aos";
import "aos/dist/aos.css";

import Intro from "./components/Intro/intro";
import NavigationBar from "./components/NavigationBar/NavigationBar";
import Scroll from "./components/Scroll/Scroll.js"
import AboutMe from "./components/About-me/about-me";

function App() {
  useEffect(() => {
    AOS.init();
    AOS.refresh();
  }, []);
  return (
    <div>
      <div className="pageWrap"></div>
      <div id="white-top"></div>
      <Intro></Intro>
      <NavigationBar></NavigationBar>
      <Scroll></Scroll>
      <AboutMe></AboutMe>
        <pre id="mySkills-description"></pre>
        <div className="subtitle" id="experiences-title">
          My Experiences<span style={{ color: "#e4448f" }}>.</span>
        </div>
        <hr id="experiences-line"></hr>
        <pre id="experiences-description"></pre>
        <div className="subtitle" id="projects-title">
          My Projects<span style={{ color: "#e4448f" }}>.</span>
        </div>
        <hr id="projects-line"></hr>
      </div>
  );
}

export default App;
